import React from 'react';
import './Contact.css';

function Contact() {
  return (
    <div className="contact">
      <h2>Contact Us</h2>
      <p>Email: info@educationcompany.com</p>
      <p>Phone: +123 456 7890</p>
      <p>Address: 123 Education Lane, Knowledge City</p>
    </div>
  );
}

export default Contact;
